package acmicpc.no14500;

import java.io.BufferedReader;
import java.io.IOException;
import java.io.InputStreamReader;
import java.util.StringTokenizer;

public class Main {

    /*
     문제 : 테트로미노
     유형 : DFS
     시간 복잡도 : O(N * M)
     난이도 : 조금 어려움
     시간 : 2h 30m
     uri : https://www.acmicpc.net/problem/14500
     날짜 : 22.11.9
     refer : https://girawhale.tistory.com/35
     */
    static boolean[][] check;
    static int[] dx = {1, 0, -1, 0};
    static int[] dy = {0, 1, 0, -1};
    static int[][] ints;
    static int n;
    static int m;

    public static void main(String[] args) throws IOException {
        BufferedReader br = new BufferedReader(new InputStreamReader(System.in));
        StringTokenizer st = new StringTokenizer(br.readLine());
        n = Integer.parseInt(st.nextToken());
        m = Integer.parseInt(st.nextToken());
        check = new boolean[n][m];
        ints = new int[n][m];
        for (int i = 0; i < n; i++) {
            st = new StringTokenizer(br.readLine());
            for (int j = 0; j < m; j++) {
                ints[i][j] = Integer.parseInt(st.nextToken());
            }
        }
        Tetromino[] tetrominos = {
            new Tetromino(m - 2, n - 1, true,
                new int[][]{{0, 0}, {1, 0}, {1, 1}, {2, 0}}),
            new Tetromino(m - 2, n - 1, true,
                new int[][]{{0, 1}, {1, 0}, {1, 1}, {2, 1}}),
            new Tetromino(m - 1, n - 2, true,
                new int[][]{{0, 0}, {0, 1}, {1, 1}, {0, 2}}),
            new Tetromino(m - 1, n - 2, true,
                new int[][]{{1, 0}, {1, 1}, {0, 1}, {1, 2}})
        };

        int max = 0;
        for (Tetromino tetromino : tetrominos) {
            for (int i = 0; i < tetromino.iRange; i++) {
                for (int j = 0; j < tetromino.jRange; j++) {
                    int sum = 0;
                    for (int[] anInt : tetromino.ints) {
                        if (tetromino.a) {
                            sum += ints[j + anInt[1]][i + anInt[0]];
                        } else {
                            sum += ints[i + anInt[1]][j + anInt[0]];
                        }
                    }
                    max = Math.max(sum, max);
                }
            }
        }
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < m; j++) {
                check[i][j] = true;
                max = Math.max(max, dfs(1, ints[i][j], i, j));
                check[i][j] = false;
            }
        }
        System.out.println(max);
    }

    private static int dfs(int count, int sum, int i, int j) {
        if (count == 4) {
            return sum;
        }

        int max = 0;
        for (int k = 0; k < 4; k++) {
            int x = j + dx[k];
            int y = i + dy[k];
            if (0 <= x && x < m && 0 <= y && y < n && !check[y][x]) {
                check[y][x] = true;
                max = Math.max(max, dfs(count + 1, sum + ints[y][x], y, x));
                check[y][x] = false;
            }
        }
        return max;
    }

    static class Tetromino {
        int iRange;
        int jRange;
        boolean a;
        int[][] ints;

        public Tetromino(int iRange, int jRange, boolean a, int[][] ints) {
            this.iRange = iRange;
            this.jRange = jRange;
            this.a = a;
            this.ints = ints;
        }
    }
}

